package com.example.doctour.data.remote.dtos.authimport com.google.gson.annotations.SerializedNamedata class SignUpDto(    @SerializedName("username")    val username: String,    @SerializedName("number")    val number: String,    @SerializedName("password")    val password: String,    @SerializedName("password_again")    val password_again: String)